import React from 'react';
import './icons.scss';

const Profile = ({ name }) => {
  switch (name.toLowerCase()) {
    case 'buyer':
      return <Buyer />;
    case 'supplier':
      return <Supplier />;
    case 'transporter':
      return <Transporter />;
    case 'ggcb':
    case 'uscts':
      return <Auditor />;

    case 'factor-1':
    case 'factor-2':
      return <Factor />;

    default:
      return <Buyer />;
  }
};

